      H4 are for employees who did not spend more than 25% of their compensated time
      during the reporting period on Fed election activities or activities in connection
      with a Federal election. All transfers for allocated activity reported on Sch
      H3 occurred within the 70-day permitted window of time. The Committee uses the
      Escrow option for receipt of corporate in-kind donations as provided for by
      the Commission in Advisory Opinion 1992-33. The method ensures that prohibited
      sources are not used to fund the federal share of allocable activity expenses.
